      .get(
        "https://maps.googleapis.com/maps/api/geocode/json?latlng=40.714224,-73.961452&key=AIzaSyDUAgs6Oz0iTMoHUzxuv95F4yN4ehY2xrc"
      )
      .then((result) => {
        let words = result.data.results[0].replace(",", "").split(" ");
        console.log(words[-2]);
      });
    return snapshot.docs.map((doc) => {
